const searchInput: SearchInput = {
  query: 'calendar event',
};

metaToolAPI.search(searchInput).then((searchOutput: SearchOutput) => {
  if (searchOutput.results && searchOutput.results.length > 0) {
    const toolName = searchOutput.results[0].name;
    const tomorrow = new Date();
    tomorrow.setDate(tomorrow.getDate() + 1);
    tomorrow.setHours(15, 0, 0, 0);

    const validateParamsInput: ValidateParamsInput = {
      tool_name: toolName,
      params: {
        date: tomorrow.toISOString(),
        time: '15:00',
      },
    };

    metaToolAPI.validate_params(validateParamsInput).then((validateParamsOutput: ValidateParamsOutput) => {
      if (validateParamsOutput.valid) {
        console.log('Event created successfully');
      } else {
        console.log('Failed to create event', validateParamsOutput.errors);
      }
    });
  } else {
    console.log('No matching tools found');
  }
});
